import React from 'react' 

class Footer extends React.Component{
    render (){
        return (
            <div id='footer' className='bg-white pb-5 pt-5'>
                <div className='container'>
                    <div className='row bg-grey-dark'>
                    </div> 
                </div>
            </div>
        )
    }
}

export default Footer
